4todo.html.body:
To Do List
Now let's add a todo list and use one of the newest features from the Material team, drag and drop. This schematic resides in the CDK library.

Generate the todo list by running the following command. You can pass in any name for the component. We'll use 'todo' for simplicity.
ng generate @angular/cdk:drag-drop 


Since we'll want to see both the dashboard and the todo via the nav list, we'll need to set up routing. Add routes for the dashboard and todo views in app-routing.module.ts. You'll have something similar to this depending on your component names.
app-routing.module.ts
const routes: Routes = [
{ path: 'dashboard', component: DashboardComponent },
{ path: 'todo', component: TodoComponent },
{ path: '', redirectTo: '/dashboard', pathMatch: 'full' },
{ path: '**', component: DashboardComponent }
];


In navigation.component.html, make the following changes we now want to consume the router outlet. Replace the component selector for your dashboard component (if you used the same names we did, that's ) with .

We want to build a nav menu, so first let's update the text for each anchor element in the order we want to see the menu items. First we want dashboard as the main initial view, followed by the todo list. Update the text in the first two anchor elements to "Dashboard" and "Todo".

The @angular/material:nav schematic automatically adds href attributes to the anchor tags. Since we want to use the router, replace the href with routerLink for both "Dashboard" and "Todo".

We need to set the routerLink value. The value should match the route you defined in app-routing.module.ts (plus a slash in front) for the component. For dashboard, use the value /dashboard. Repeat for "Todo" anchor element. Your "Dashboard" anchor element will look like this:
navigation.component.html
Dashboard


Now when you click on a link the view changes between the dashboard and your todo list! But we want to make it easy to see which link we're on by changing the color of the link when it's in view. Add the routerLinkActive="active" directive and value to the dashboard and todo anchor tags. This will use a class we'll create named .active whenenver the router link associated to that view is active.

In navigation.component.scss, add a class for .mat-list-item.active to set the background color. You can pick any color of your choosing or we can set it to the complementary (accent) color of your material theme by importing the theming file and using the complementary color (shown in the code snippet below).
Your navigation component code will look like this
 navigation.component.htmlnavigation.component.scss
  
